import Company from './Company.js';
import NewCompany from './NewCompany.js';

function CompanyList(props) {
    const { companies, setCompanies } = props;

    return (
        <div className='company-list'>
            <h2>Companies</h2>

            <NewCompany companies={companies} setCompanies={setCompanies} />

            <table onClick={(e) => e.stopPropagation()}>
                <thead>
                    <tr>
                        <th style={{ fontSize: '13px' }}>Phone Type</th>
                        <th style={{ fontSize: '13px' }}>Number</th>
                        <th style={{ fontSize: '13px' }}>Modification Update or Delete</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        companies.map((company) => {
                            return (
                                <Company key={company.id} company={company} companies={companies} setCompanies={setCompanies} />
                            );
                        })
                    }
                </tbody>
            </table>
        </div>
    );
}

export default CompanyList;
